import React from "react";

// Components
import EntertainmentCardSlider from "../components/EntertainmentCard/Entertainmentcard.component";
import Premier from "../components/Premier/Premier.component";

const HomePage = () => {

  return (

    <>

      <div className="container  mx-auto xl:px-16 px-4 ">
        <h1 className="text-2xl font-bold text-gray-800 my-3">
          The best of Entertainment
        </h1>
        <EntertainmentCardSlider />
      </div>


      <div className="bg-gray-800 py-16">

        <div className="hidden item-center justify-between md:flex">
        <img src="https://in.bmscdn.com/discovery-catalog/collections/tr:w-1440,h-120/premiere-rupay-banner-web-collection-202104230555.png"  />
             alt="pre"

        </div>


        <div className="container xl:px-16 mx-auto px-4">
          <Premier />

        </div>

      </div>


    </>

  );
};

export default HomePage;
